import React, { useState, useEffect } from 'react';
import { supabase } from './supabaseClient';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
} from 'chart.js';
import { Line } from 'react-chartjs-2';
import 'chartjs-adapter-date-fns';

// Register Chart.js components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
);

ChartJS.defaults.responsive = true;
ChartJS.defaults.maintainAspectRatio = false;

const calculateHVACReduction = (value) => {
  return value * 0.7; // 30% reduction
};

const calculateEcologicaReduction = (value) => {
  return value * 0.6; // 40% reduction
};

const calculateCombinedReduction = (value) => {
  return value * 0.5; // 50% reduction
};

const calculateDeeperSleepMinutes = (data, hasHVAC, hasEcologica) => {
  const getAdjustedValue = (value) => {
    if (hasHVAC && hasEcologica) {
      return calculateCombinedReduction(value);
    } else if (hasHVAC) {
      return calculateHVACReduction(value);
    } else if (hasEcologica) {
      return calculateEcologicaReduction(value);
    }
    return value;
  };

  // Count days where PM2.5 is 5 or under after reductions
  const daysUnderThreshold = data.filter(day => {
    const adjustedValue = getAdjustedValue(parseFloat(day['PM 2.5']));
    return adjustedValue <= 5;
  }).length;

  // Calculate total minutes of deeper sleep
  // days × 8 hours × 60 minutes
  const deeperSleepMinutes = daysUnderThreshold * 8 * 60;

  return deeperSleepMinutes;
};

const Dashboard = () => {
  const [airQualityData, setAirQualityData] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [city, setCity] = useState('Toronto');
  const [firstName, setFirstName] = useState('');
  const [hasHVAC, setHasHVAC] = useState(false);
  const [hasEcologica, setHasEcologica] = useState(false);

  // Calculate reductions
  const calculateHVACReduction = (value) => value * 0.7; // 30% reduction
  const calculateEcologicaReduction = (value) => value * 0.6; // 40% reduction
  const calculateCombinedReduction = (value) => value * 0.5; // 50% reduction

  useEffect(() => {
    const fetchUserPreferences = async () => {
      try {
        const { data: { user } } = await supabase.auth.getUser();
        if (user) {
          const { data: preferences, error } = await supabase
            .from('user_preferences')
            .select('city, first_name, has_HVAC, has_ecologgica')
            .eq('user_id', user.id)
            .single();

          if (error) throw error;
          if (preferences) {
            setCity(preferences.city);
            setFirstName(preferences.first_name || '');
            setHasHVAC(preferences.has_HVAC || false);
            setHasEcologica(preferences.has_ecologgica || false);
          }
        }
      } catch (error) {
        console.error('Error fetching user preferences:', error);
      }
    };
    fetchUserPreferences();
  }, []);

  // Modify the Line chart data to include reduction calculations
  const getChartData = (data) => ({
    labels: data.map(d => d.date),
    datasets: [
      {
        label: 'Original PM2.5',
        data: data.map(d => d['PM 2.5']),
        borderColor: 'rgb(75, 192, 192)',
        tension: 0.1
      },
      hasHVAC && {
        label: 'PM2.5 with HVAC',
        data: data.map(d => calculateHVACReduction(d['PM 2.5'])),
        borderColor: 'rgb(34, 139, 34)',
        tension: 0.1
      },
      hasEcologica && {
        label: 'PM2.5 with Ecologica',
        data: data.map(d => calculateEcologicaReduction(d['PM 2.5'])),
        borderColor: 'rgb(60, 179, 113)',
        tension: 0.1
      },
      (hasHVAC && hasEcologica) && {
        label: 'PM2.5 with Both',
        data: data.map(d => calculateCombinedReduction(d['PM 2.5'])),
        borderColor: 'rgb(144, 238, 144)',
        tension: 0.1
      }
    ].filter(Boolean) // Remove false values from conditional rendering
  });

  useEffect(() => {
    const fetchAirQualityData = async () => {
      try {
        console.log('Fetching data for city:', city);
        const API_URL = 'http://localhost:5000';
        const response = await fetch(`${API_URL}/api/airqualitydata`);

        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }
        const data = await response.json();
        console.log('Raw data received:', data.length, 'records');

        const last30DaysData = getLast30Days(data, city);
        console.log('Filtered 30 days data:', last30DaysData.length, 'records');

        setAirQualityData(last30DaysData);
      } catch (error) {
        console.error('Error fetching air quality:', error);
      } finally {
        setIsLoading(false);
      }
    };

    fetchAirQualityData();
  }, [city]);

  return (
    <div className="dashboard">
      <h1>{firstName ? `${firstName}'s ` : ''}{city} Dashboard</h1>
      {isLoading ? (
        <div>Loading...</div>
      ) : (
        airQualityData.length > 0 ? (
          <Line 
            data={getChartData(airQualityData)} 
            options={chartOptions} 
          />
        ) : (
          <div>No data available for {city}</div>
        )
      )}
    </div>
  );
};

export default Dashboard;
